import React, { useState } from 'react';
import { fetchData } from '../api';

const HealthForm = () => {
    const [formData, setFormData] = useState({
        age: '',
        height: '',
        weight: '',
        activityLevel: '',
        gender: '',  // 'M' für Männlich, 'W' für Weiblich
        dailyWaterIntake: '',
        sleepHours: '',
        stressLevel: '',
    });

    const handleChange = (name, value) => {
        setFormData({
            ...formData,
            [name]: value
        });
    };

    const handleSubmit = async () => {
        // Logische Einschränkungen
        if (formData.age < 1 || formData.age > 120) {
            alert('Bitte geben Sie ein gültiges Alter ein (1-120 Jahre).');
            return;
        }
        if (formData.height < 50 || formData.height > 250) {
            alert('Bitte geben Sie eine gültige Größe ein (50-250 cm).');
            return;
        }
        if (formData.weight < 10 || formData.weight > 300) {
            alert('Bitte geben Sie ein gültiges Gewicht ein (10-300 kg).');
            return;
        }
        if (formData.activityLevel < 1 || formData.activityLevel > 5) {
            alert('Bitte geben Sie ein gültiges Aktivitätslevel ein (1-5).');
            return;
        }
        if (formData.dailyWaterIntake < 1 || formData.dailyWaterIntake > 20) {
            alert('Bitte geben Sie eine gültige tägliche Wasseraufnahme ein (1-20 Gläser).');
            return;
        }
        if (formData.sleepHours < 1 || formData.sleepHours > 24) {
            alert('Bitte geben Sie eine gültige Anzahl an Schlafstunden ein (1-24 Stunden).');
            return;
        }
        if (formData.stressLevel < 1 || formData.stressLevel > 10) {
            alert('Bitte geben Sie ein gültiges Stresslevel ein (1-10).');
            return;
        }

        const data = await fetchData('/predict', formData);
        console.log('Erhaltene Daten:', data);
        // Hier kannst du die Daten weiterverarbeiten oder anzeigen
    };

    return (
        <div style={styles.container}>
            <h2 style={styles.header}>Health Assessment Form</h2>
            <label style={styles.label}>Alter:</label>
            <input
                style={styles.input}
                type="number"
                value={formData.age}
                onChange={e => handleChange('age', e.target.value)}
            />
            <label style={styles.label}>Größe (cm):</label>
            <input
                style={styles.input}
                type="number"
                value={formData.height}
                onChange={e => handleChange('height', e.target.value)}
            />
            <label style={styles.label}>Gewicht (kg):</label>
            <input
                style={styles.input}
                type="number"
                value={formData.weight}
                onChange={e => handleChange('weight', e.target.value)}
            />
            <label style={styles.label}>Aktivitätslevel (1-5):</label>
            <input
                style={styles.input}
                type="number"
                value={formData.activityLevel}
                onChange={e => handleChange('activityLevel', e.target.value)}
            />
            <label style={styles.label}>Geschlecht:</label>
            <select
                style={styles.input}
                value={formData.gender}
                onChange={e => handleChange('gender', e.target.value)}
            >
                <option value="">Bitte wählen...</option>
                <option value="M">Männlich</option>
                <option value="W">Weiblich</option>
            </select>
            <label style={styles.label}>Tägliche Wasseraufnahme (Gläser):</label>
            <input
                style={styles.input}
                type="number"
                value={formData.dailyWaterIntake}
                onChange={e => handleChange('dailyWaterIntake', e.target.value)}
            />
            <label style={styles.label}>Schlafstunden:</label>
            <input
                style={styles.input}
                type="number"
                value={formData.sleepHours}
                onChange={e => handleChange('sleepHours', e.target.value)}
            />
            <label style={styles.label}>Stresslevel (1-10):</label>
            <input
                style={styles.input}
                type="number"
                value={formData.stressLevel}
                onChange={e => handleChange('stressLevel', e.target.value)}
            />
            <button style={styles.button} onClick={handleSubmit}>Absenden</button>
        </div>
    );
};

const styles = {
    container: {
        maxWidth: '400px',
        margin: '0 auto',
        padding: '20px',
        backgroundColor: '#f9f9f9',
        borderRadius: '10px',
        boxShadow: '0px 4px 8px rgba(0, 0, 0, 0.1)',
    },
    header: {
        textAlign: 'center',
        color: '#007bff',
        marginBottom: '20px',
        fontSize: '24px',
        fontWeight: 'bold',
    },
    label: {
        display: 'block',
        marginBottom: '8px',
        color: '#333',
    },
    input: {
        height: '40px',
        borderColor: 'gray',
        borderWidth: '1px',
        marginBottom: '10px',
        paddingLeft: '8px',
        display: 'block',
        width: '100%',
        boxSizing: 'border-box',
        borderRadius: '5px',
    },
    button: {
        backgroundColor: '#007bff',
        color: 'white',
        padding: '10px 20px',
        border: 'none',
        borderRadius: '5px',
        cursor: 'pointer',
        width: '100%',
        fontSize: '16px',
        fontWeight: 'bold',
        boxShadow: '0px 4px 8px rgba(0, 0, 0, 0.2)',
    },
};

export default HealthForm;
